import React from "react";
import "./User_details.css";
import User from "./User";
import user from "../assets/user.svg";
import Header from "../Workplace/Header";
import building from "../assets/building.svg";
import department from "../assets/department.svg";
import location from "../assets/location.svg";
import toolbox from "../assets/toolbox.svg";
import key from "../assets/key.svg";

function User_details() {
    return (
        <div>
            <Header />
            <User />
            <div className="user_details">
                <h2>Collaborator details</h2>
                <img src={user} alt="" className="user_img" />
                <div className="profile_user">
                    <div className="one">My Account</div>
                    <div>
                        <img src={toolbox} alt="" className="toolbox" />
                        Project Manager
                    </div>
                    <div>My Account</div>
                    <div>My Account</div>
                    <div></div>
                    <div></div>
                    <div>My Account</div>
                    <div>My Account</div>
                    <div>My Account</div>
                </div>
            </div>
        </div>
    );
}

export default User_details;
